import React from "react";
import EnemyCemetry from "./Game/EnemyCemetry";
import Board from "./Game/Board";
import PlayerCemetry from "./Game/PlayerCemetry";
import "./Game.css";

function Game({ GameModel }) {
    const { _board } = GameModel;

    return (
        <div className="Game">
            {/* Сбитые шашки противника */}
            <EnemyCemetry deadCheckers={_board.deadEnemyCheckers} />

            {/* Основная доска */}
            <Board GameModel={GameModel} />

            {/* Ваши сбитые шашки */}
            <PlayerCemetry deadCheckers={_board.deadPlayerCheckers} />
        </div>
    );
}

export default Game;
